(42, 14, 81, 34, 'Coughing since earthquake\r\nCame here in June, received amoxicillin, Zyrtec, albuterol for asthma and pneumonia\r\nCoughing with yellow sputum, foul odor\r\nWakes him up at night\r\nTrouble breathing, SOB on exertion\r\nSometimes has weak knees, stomach pain. Last time was last week.\r\nVomits when he eats, frequently.\r\nRecent weight loss, fatigued, \r\nFever with night sweats and chills.', '2014-12-27 10:29:54', 77),
(43, 14, 81, 38, 'Pneumonia\r\nAsthma', '2014-12-27 10:29:54', NULL),
(44, 14, 81, 40, 'Amoxicillin, Zyrtec, albuterol', '2014-12-27 10:29:54', NULL),
(45, 6, 84, 34, 'pt. presents with one year abdominal pain, worst in the morning. pain resolves with food, is worst when he doesn''t eat. pain is abrupt onset, lasts about 2 hours. no wt. loss, doesnt drink much coffee, drinks some alcohol, smokes occasionally. no blood in stool or dark stools.', '2014-12-27 10:32:57', 79),
