(49, 6, 84, 41, 'na', '2014-12-27 10:32:57', NULL),
(50, 6, 84, 35, 'pt. in no apparent distress with abdominal pain', '2014-12-27 10:32:57', NULL),
(51, 6, 84, 36, 'gastritis', '2014-12-27 10:32:57', NULL),
(52, 13, 83, 34, 'Cough green sputum\r\n\r\nClear pebble stool\r\n\r\nPhysical exam \r\n\r\nRight ear otitis media', '2014-12-27 10:33:29', 75),
(53, 13, 83, 35, 'Otitis media found on physical exam', '2014-12-27 10:33:29', NULL),
(54, 13, 83, 36, 'Otitis media', '2014-12-27 10:33:29', NULL),
(55, 8, 82, 34, 'Patient presents with a headache, which has been going on for a year.  The pain starts around her forehead and eyes and goes to her entire head. She has the feeling that her head is swelling with the pain. The pain comes on gradually. It sometimes radiates down her neck. She says when she eats salt the pain becomes worse, but the pain is always present. She is also complaining of back pain, difficulty sleeping, and loss of appetite with the headache.', '2014-12-27 10:36:19', 78),
(56, 8, 82, 38, 'Anemia, GERD', '2014-12-27 10:36:19', NULL),
(57, 8, 82, 40, 'Omeprazole, iron 65 mg, calcium 600 mg', '2014-12-27 10:36:19', NULL),
(58, 13, 77, 34, 'Right otitis media\r\n\r\nUpper resp symptoms', '2014-12-27 10:38:57', 74),
(59, 13, 77, 36, 'Otitis media', '2014-12-27 10:38:57', NULL),
(60, 14, 87, 34, 'Stomach pain for 1 year\r\nAfter he eats, has acid pain. SOB when the pain comes.\r\nWeight loss, fatigue, \r\nPain radiates to lower back.\r\n\r\nPain on urination, takes a long time to start pee, 6 months. Pain right above pubic area, lower back.\r\nNo fever, some headaches, dizziness.\r\n Knee pain for 1 yr, weakness of lower body', '2014-12-27 10:41:03', 80),
