(4701, 74, 1555, 34, 'R eye pain for 2 years. Had a motorcycle accident 2 years ago. Hurt his eye--pain since then, lateral side is painful and has excessive tearing. Chronic headaches. Blurry vision since the accident all the time.  Can move eye and never loses vision. Dizziness one day per week. Also has dislocated L shoulder and R wrist pain. Had stitches in eye but no treatment on arm and shoulder. Pain is worse at nights and can''t sleep. Works in agriculture. Has pain when he works. Can see colors out of L eye but not objects. Can see colors out of R eye but not as well as the L. \r\n\r\nScapula out of place. Range of motion in wrists are the same. \r\n\r\nR eye palsy.', '2015-05-16 11:36:45', 2100),
