(4722, 76, 1568, 34, 'He works in the fields and he is outside all day. The pain in his back started a year ago. It hurts mroe at night after work. He uses a cream like a mint cream. He does not have anymore but it helped when he used it. The pain in his back moves down his legs when he is working. He had an accident a year ago where a tree fell on his neck and leg, which started the pain. He had a cast on his arm and leg. He rested for two months and then he started to work again. He also had the pain right away. \r\n\r\nIn his eyes It is a burning pain and it can itch as well. His vision doesnt change. He has not tried anything to alleviate the pain. \r\n\r\nHis head pain is mostly in the back of his head.', '2015-05-16 12:10:27', 2115),
(4723, 88, 1565, 34, 'The patient is a 5 yo female presenting with frequent illnesses, respiratory infections and ear pain. It started 3 months ago. She went to the medical center to get medication but it did not work. She had to go to the hospital because of a respiratory infection and received a blood transfusion. Her father said she was anemic at the time. She had only had a blood infusion once. Her ear pain started at the same time of the respiratory infection. She has also been having headaches with pressure in the sinuses. She has itchy and watery eyes as well. \r\n\r\nShe was here in March and was given medication for her fever which helped. She has been sick 2 times since then.', '2015-05-16 12:13:25', 2112),
