(13, 'e9fb59ba6218889e05b25bac81fb511fa982053f', '2014-12-14 00:56:38', 'ALTER TABLE `patients`\nCHANGE COLUMN `sex` `sex` VARCHAR(10) NULL  ,\nCHANGE COLUMN `address` `address` VARCHAR(255) NULL  ;', 'ALTER TABLE `patients`\nCHANGE COLUMN `sex` `sex` VARCHAR(10) NOT NULL  ,\nCHANGE COLUMN `address` `address` VARCHAR(255) NOT NULL  ;', 'applied', ''),
